export const Body = () => {
  return (
    <>
      <div className="body">
        <h1 className="body1" id="body">
          The Best June Plums - Always Fresh - Always Green
        </h1>
        <div>
          <h3>Shipping Available</h3>
        </div>
      </div>
    </>
  );
};
